[include mainsail.cfg]

# This file contains common pin mappings for the BigTreeTech Octopus V1.
# To use this config, the firmware should be compiled for the STM32F446 with a "32KiB bootloader"
# Enable "extra low-level configuration options" and select the "12MHz crystal" as clock reference

# after running "make", copy the generated "klipper/out/klipper.bin" file to a
# file named "firmware.bin" on an SD card and then restart the OctoPus with that SD card.

# See docs/Config_Reference.md for a description of parameters.

## Voron Design VORON2 250/300/350mm BigTreeTech OctoPus V1 TMC2209 UART config

## *** THINGS TO CHANGE/CHECK: ***
## MCU paths                            [mcu] section
## Thermistor types                     [extruder] and [heater_bed] sections - See https://www.klipper3d.org/Config_Reference.html#common-thermistors for common thermistor types
## Z Endstop Switch location            [safe_z_home] section
## Homing end position                  [gcode_macro G32] section
## Z Endstop Switch  offset for Z0      [stepper_z] section
## Probe points                         [quad_gantry_level] section
## Min & Max gantry corner postions     [quad_gantry_level] section
## PID tune                             [extruder] and [heater_bed] sections
## Probe pin                            [probe] section
## Fine tune E steps                    [extruder] section

[mcu]
##  Obtain definition by "ls -l /dev/serial/by-id/" then unplug to verify
##--------------------------------------------------------------------
serial: /dev/serial/by-id/usb-Klipper_stm32f446xx_0A0025001350565843333620-if00
restart_method: command
##--------------------------------------------------------------------

[mcu t0]
canbus_uuid: 4e1cf0b395d6

[mcu cpap]
canbus_uuid: 044ddaeae211

[mcu scanner]
canbus_uuid: 8824bdc0a804

[axis_twist_compensation]

[force_move]
enable_force_move: True

[include mainsail.cfg]
[include ./_configuration/_stepper.cfg]
[include ./_configuration/_sensors.cfg]
[include ./_configuration/_bed_heater.cfg]
[include ./_configuration/_fans.cfg]
#[include ./_configuration/_probe.cfg]
[include ./_configuration/_sensorless.cfg]
[include ./_configuration/_homing.cfg]
[include ./_configuration/_extruder.cfg]
[include ./_configuration/_cpap.cfg]
[include ./_configuration/_scanner.cfg]

[include ./_macros/macros.cfg]
[include ./_macros/clean_nozzle.cfg]

[include LEDCONTROL.cfg]

### includes for ToolChanger ###
[include ./_toolchanger/toolchanger.cfg]
[include ./_toolchanger/tool_detection.cfg]
[include ./_toolchanger/homing.cfg]
[include ./_toolchanger/T0.cfg]
[include ./_toolchanger/macros.cfg]
[include ./_toolchanger/calibrate_offset.cfg]
### includes for ToolChanger ###


[printer]
kinematics: corexy
max_velocity: 450  
max_accel: 5000             #Max 4000
max_z_velocity: 20          #Max 15 for 12V TMC Drivers, can increase for 24V
max_z_accel: 500
square_corner_velocity: 5.0


#####################################################################
#   Homing and Gantry Adjustment Routines
#####################################################################

[idle_timeout]
timeout: 1800


[bed_mesh]
zero_reference_position: 150, 150 # The centre of your bed. 
speed: 450
horizontal_move_z: 3
mesh_min: 20, 41 # The first probed coordinate, nearest to the origin. This coordinate is relative to the probe's location.
mesh_max: 280, 285 # The probed coordinate farthest from the origin. This is not necessarily the last point probed, as the probing process occurs in a zig-zag fashion. As with mesh_min, this coordinate is relative to the probe's location.
probe_count: 50, 50
adaptive_margin: 10
mesh_pps: 0,0 # Disable interpolation - mesh is probably dense enough


[include shell_command.cfg]

